import React from "react";
import styled from '@emotion/styled'
import Card from 'Card'

const Container = styled.div`
    display: flex;
    flex-wrap: nowrap;
    justify-content: center;

`

const Grid = ({ emojis }) => {
    let id = 0;

    const list = emojis.map( emoji => {
        return <p> emoji={emoji} key={id++}</p>
    })

    return (
        <Container>
            {list}
        </Container>
    )
}

export default Grid;
